import {useState} from 'react';
import './Startup.css'; // Import your CSS file for styling

const StartupForm = () => {
  const [name, setname] = useState(''); 
  const [email, setemail] = useState(''); 
  const [password, setpassword] = useState(''); 
  const [dateofbirth, setdateofbirth] = useState(''); 
  const [gender, setgender] = useState('');
  const [address, setaddress] = useState('');  
  const [mobilenumber, setmobilenumber] = useState(''); 
  const [degree, setdegree] = useState(''); 
  const [stream, setstream] = useState(''); 
  const [year, setyear] = useState(''); 

  const handleSubmit = (e) => {
    e.preventDefault();
    // Perform submission logic here
    // You can send the form data to an API or perform any other actions

    // Clear form fields after submission
    setname('');
    setemail('');
    setpassword('');
    setdateofbirth('');
    setgender('');
    setaddress('');
    setmobilenumber('');
    setdegree('');
    setstream('');
    setyear('');
  };

  const handleClick=(e)=>{
    e.preventDefault()
    const edu={name,email,password,dateofbirth,gender,address,mobilenumber,degree,stream,year}
    console.log(edu)
    fetch("http://localhost:2022/startup",{
      method:"POST",
      headers:{"Content-Type":"application/json"},
      body:JSON.stringify(edu)

  }).then(()=>{
    console.log("New buyer added")
  })
}
  return (
    <div className="container-33">
      <h1 id='hed-24'>Startup Form</h1>
      {/* <p>Please fill in this form</p> */}
      <form>
        <label For="name"><b>Name</b></label>
        <input type="text" name="name" placeholder="Enter your name" required />

        <label For="email"><b>Email</b></label>
        <input type="email" placeholder="Enter Email" name="email" required />

        <label For="psw"><b>Password</b></label>
        <input type="password" placeholder="Enter Password" name="psw" required />

        
        <label For="dob"><b>Date of Birth</b></label>
        <input type="date" name="dob" required />
        <br></br><br></br>
        <label For="gender"><b>Gender</b></label>
        <select name="gender" required>
          <option value="male">Male</option>
          <option value="female">Female</option>
          <option value="other">Other</option>
        </select>
        <br></br>
        <label For="address"><b>Address</b></label>
        <input type="textarea" name="address" placeholder="Enter Address" required />

        <label For="phone"><b>Phone Number</b></label>
        <br />
        <select name="phoneCode" required>
          <option selected hidden value="">Code</option>
          <option value="91">+91</option>
          <option value="99">+99</option>
          <option value="90">+90</option>
          <option value="66">+66</option>
        </select>
        <input type="tel" name="phone" placeholder="8123456781" required />


        <label For="Degree"><b>Qualification</b></label>
        <input type="text" Degree="Degree" placeholder="Enter your qualification" required />


        <label For="stream"><b>Stream</b></label>
        <input type="text" stream="stream" placeholder="Enter your stream" required />



        <label For="year"><b>Year</b></label>
        <input type="text" year="year" placeholder="Enter your year of pass" required />


        <label For="Share"><b>Startup Idea</b></label>
        <input type="text" name="Share" placeholder="Enter Your Idea" required />

        {/* <p>By creating an account you agree to our <a href="#" style={{ color: 'dodgerblue' }}>Terms & Privacy</a>.</p> */}

        <div className="button-12">
          <button type="submit" className="buttonsub2" >submit</button>
        </div>
      </form>
      {/* <div className="youtubeBtn">
        <a target="_blank" href="https://www.youtube.com/watch?v=7k8kKRQa9jY">
          <span>Watch on YouTube</span>
          <i className="fab fa-youtube"></i>
        </a>
      </div> */}
    </div>
  );
}

export default StartupForm;
